import React from 'react';
import PropTypes from 'prop-types';
import { makeStyles } from '@material-ui/core/styles';
import AppBar from '@material-ui/core/AppBar';
import Tabs from '@material-ui/core/Tabs';
import Tab from '@material-ui/core/Tab';
import Typography from '@material-ui/core/Typography';
import Box from '@material-ui/core/Box';
import TextareaAutosize from '@material-ui/core/TextareaAutosize';
import CssBaseline from '@material-ui/core/CssBaseline';
import Container from '@material-ui/core/Container';
import ButtonGroup from '@material-ui/core/ButtonGroup';
import Button from '@material-ui/core/Button';
import Grid from '@material-ui/core/Grid';


function TabPanel(props) {
  const { children, value, index, ...other } = props;

  return ( 
    <div
      role="tabpanel"
      hidden={value !== index}
      id={`simple-tabpanel-${index}`}
      aria-labelledby={`simple-tab-${index}`}
      {...other}
    >
      {value === index && (
        <Box p={3}>
          <Typography>{children}</Typography>
        </Box>
      )}
    </div>
  );
}

TabPanel.propTypes = {
  children: PropTypes.node,
  index: PropTypes.any.isRequired,
  value: PropTypes.any.isRequired,
};

function a11yProps(index) {
  return {
    id: `simple-tab-${index}`,
    'aria-controls': `simple-tabpanel-${index}`,
  };
}

const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
    backgroundColor: theme.palette.background.paper,
  },
}));

export default function SimpleTabs() {
  const classes = useStyles();
  const [value, setValue] = React.useState(0);

  const handleChange = (event, newValue) => {
    setValue(newValue);
  };

  return (
    <div className={classes.root}>
        <Grid container spacing={3}>
        <Grid item xs={12} sm={6}>
        </Grid>
        <Grid item xs={12} sm={6}>

      <AppBar position="static">
        <Tabs value={value} onChange={handleChange} aria-label="simple tabs example">
          <Tab label="5:10" {...a11yProps(0)} />
          <Tab label="14:13" {...a11yProps(1)} />
          <Tab label="22:21" {...a11yProps(2)} />
        </Tabs>
      </AppBar>
      <TabPanel value={value} index={0}>
      <Typography variant="h4">
        Let's talk about the pin at 5:10
      </Typography>
        <Typography> My notes</Typography>
        <TextareaAutosize aria-label="minimum height" rowsMin={3} placeholder="Minimum 3 rows" />
        <Typography variant="h5"> Talk with Julia about:</Typography>
        <Typography> What is your perspective of what happened at this pin?</Typography>
        <Grid container spacing={3}>
        <Grid item xs={6}>
        <TextareaAutosize aria-label="minimum height" rowsMin={3} placeholder="Minimum 3 rows" />
        </Grid>
        <Grid item xs={6}>
        <TextareaAutosize aria-label="minimum height" rowsMin={3} placeholder="Minimum 3 rows" />
        </Grid>
        </Grid>
        <Typography> What MI skills were or could have been used here?</Typography>
        <Grid container spacing={3}>
        <Grid item xs={6}>
        <TextareaAutosize aria-label="minimum height" rowsMin={3} placeholder="Minimum 3 rows" />
        </Grid>
        <Grid item xs={6}>
        <TextareaAutosize aria-label="minimum height" rowsMin={3} placeholder="Minimum 3 rows" />
        </Grid>
        </Grid>
        <Typography>Why was this effective or ineffective?
If the latter, what could you say instead?</Typography>
        <TextareaAutosize aria-label="minimum height" rowsMin={3} placeholder="Minimum 3 rows" />
      </TabPanel>
      <TabPanel value={value} index={1}>

        <Typography> Notes for me</Typography>
        <TextareaAutosize aria-label="minimum height" rowsMin={3} placeholder="Minimum 3 rows" />
        <Typography > To share with Julia:</Typography>
        <Typography> What is your perspective of what happened at this pin?</Typography>
        <TextareaAutosize aria-label="minimum height" rowsMin={3} placeholder="Minimum 3 rows" />
        <Typography> What would you categorize this pin as?</Typography>
        <ButtonGroup disableElevation variant="contained" color="primary">
            <Button>Strength</Button>
            <Button>Opportunity</Button>
        </ButtonGroup>      

      </TabPanel>
      <TabPanel value={value} index={2}>
        <Typography> Notes for me</Typography>
        <TextareaAutosize aria-label="minimum height" rowsMin={3} placeholder="Minimum 3 rows" />
        <Typography > To share with Julia:</Typography>
        <Typography> What is your perspective of what happened at this pin?</Typography>
        <TextareaAutosize aria-label="minimum height" rowsMin={3} placeholder="Minimum 3 rows" />
      </TabPanel>
      </Grid>
      </Grid>
    </div>
  );
}
